The Chemical Brothers are a Grammy award-winning British electronic music duo comprising Tom Rowlands and Ed Simons. Originating in Manchester in 1991, along with The Prodigy, Fatboy Slim, The Crystal Method and fellow acts, they were pioneers at bringing the big beat electronic dance genre to the forefront of pop culture.

